import React from "react";

const Pokedex = () => {
    return (
        <div>
            <div className="pagination">
                <h1 className="poke_class">Pokedex</h1>
                <div> Pagination</div>
            </div>
            <div className="">
                <div>1</div>
                <div>2</div>
                <div>3</div>
                <div>4</div>
                <div>5</div>
                <div>6</div>
                <div>7</div>
                <div>8</div>
            </div>




        </div>
    );
}
export default Pokedex;
